begin
  for reg in ( select NNUMECIDAD, CNOMECIDAD, CESTACIDAD, CCEP_CIDAD,
                   CIBGECIDAD, NNUMEREGIA, NSIAFCIDAD, CCTOMCIDAD,
                   NDDD_CIDAD, CSITUCIDAD, DINCLCIDAD, CIBNFCIDAD 
              from temp_hsscidad) loop
  
    update hsscidad
       set CCEP_CIDAD = reg.CCEP_CIDAD
     where CNOMECIDAD = reg.CNOMECIDAD
       and CESTACIDAD = reg.CESTACIDAD;
  
  end loop;
end;
